import React, {Component} from 'react';

export class Modal extends Component{
    constructor() {
        super();
        this.state = {
            show: false
        };
        this.showModal = this.showModal.bind(this);
        this.hideModal = this.hideModal.bind(this);
    }

    showModal(){
        this.setState({show: true});
    }
    hideModal(){
        this.setState({show: false});
    }

    render(){
        return(<h1>Hi</h1>);
    }
}
